INSERT [dbo].[Products] ([ProductId], [Title], [Description], [Quantity], [Price], [CreatedAt]) VALUES (1, N'Beyerdynamic DT 770 Pro', N'Der DT 770 PRO ist ein geschlossener, dynamischer Kopfhörer, der professionellen Anwendungen als Monitorhörer in Studios gerecht wird. Das einseitig geführte Kabel erleichtert den Umgang mit dem Hörer, wenn dieser ständig auf- und abgesetzt wird. Die austauschbaren Ohrpolster gewährleisten einen bequemen Tragekomfort. Innovatives Bassreflexsystem. Robuste, komfortabel gepolsterte und verstellbare Federstahl – Bügelkonstruktion. Robuster und Servicefreundlicher Aufbau durch leichte Auswechselbarkeit aller Teile. Weiche, ohrumschliessende Velours Ohrpolster.', 14, 141, CAST(N'2019-12-17T10:20:04.7333333' AS DateTime2))
GO
INSERT [dbo].[Products] ([ProductId], [Title], [Description], [Quantity], [Price], [CreatedAt]) VALUES (2, N'Bose QuietComfort 35 II', N'Erstklassige Lärmreduzierung von Bose. Mit der neuen Multifunktionstaste lässt sich der Google Assistant aufrufen oder die Stärke der Geräuschreduktion steuern. 20h Akkulaufzeit. Bose Connect App.', 39, 299, CAST(N'2019-12-17T10:20:04.7333333' AS DateTime2))
GO
INSERT [dbo].[Products] ([ProductId], [Title], [Description], [Quantity], [Price], [CreatedAt]) VALUES (3, N'Sennheiser PXC 550', N'Kabelloser Noise Cancelling Kopfhörer mit Touch-Bedienfeld.', 2, 315, CAST(N'2019-12-17T10:20:04.7333333' AS DateTime2))
